import React from 'react';
import RSVPForm from '../components/RSVPform';

const RSVP = () => {
  return (
    <>
      {/* Page Heading */}
      <section className="rsvp">
        <h2>Registration Page</h2>
      </section>

      {/* Form Section */}
      <div className="lead-form-container">
        {/* Left: Image */}
        <div className="lead-form-image">
          <div className="gallery-item">
            <img src="/images/School_image.webp" alt="St. Francis School" />
          </div>
        </div>

        {/* Right: Form */}
        <div className="lead-form-data">
          <RSVPForm />
        </div>
      </div>
    </>
  );
};

export default RSVP;
